<!DOCTYPE html>
<html lang="en" xmlns="http://www.w3.org/1999/html">
	<head>
		<meta charset="UTF-8">
		<meta name="viewport" content="width=device-width, initial-scale=1.0">
		<title>Image</title>

		<style>
			* {
				padding: 0;
				margin: 0;
				box-sizing: border-box;
			}

			body {
				width: 100%;
			}

			.wrapper {
				width: 100%;
				position: relative;
			}

			.images {
				display: grid;
				grid-template-columns: 1fr 1fr 1fr;
				grid-template-rows: 100vh;
				gap: 20px;
				padding: 10px;
			}

			.image {
				width: 100%;
				height: 100%;
				overflow: hidden;
			}

			.image img {
				width: 100%;
				height: 100%;
				object-fit: contain;
				display: block;
			}

			.auth {
				width: 100%;
				height: 100vh;
				background: #fff;
				top: 0;
				left: 0;
				position: absolute;
				display: flex;
				flex-direction: column;
				gap: 20px;
				justify-content: center;
				align-items: center;
			}

			.auth-form input {
				padding: 5px 10px;
			}

			.unauthenticated {
				overflow: hidden;
			}

			@media screen and (max-width: 1536px) {
				.images {
					grid-template-columns: 1fr 1fr;
					gap: 10px;
				}
			}

			@media screen and (max-width: 640px) {
				.images {
					grid-template-columns: 1fr;
					grid-template-rows: none;
					gap: 10px;
				}
			}
		</style>
	</head>
